import React, { useState, useEffect } from 'react'

import axios from 'axios'

import Vhes from './Vhes'

const VhesManager = (props) => {
    const[allData, setAllData] = useState([])
    const[filteredData, setFilteredData] = useState([])

    const fetchVhes = () => {
        axios.get('http://localhost:8080/vhe/vhes_list/').then(result => {
        /* axios.get('http://localhost:8000/vhe/vhe/').then(result => { */
            console.log(result)
            const response = result.data
            setAllData(response)
            setFilteredData(response)
        }).catch(e => {
            console.log('Error getting data: ' + e)
        })
    }

    const handleSearch = (e) => {
        let search_value = e.target.value.toLowerCase()
        let filtered_result = []
        filtered_result = allData.filter((data) => {
            return data.vheName.search(search_value)
        })
    }

    useEffect(() => {
      fetchVhes()
    }, [])

    if(!allData) return null

    return (
        <>
            <label>Search: </label>
            <input type='text' onChange={(e) => handleSearch(e)} />
            <Vhes
                data={allData}
            />
        </>
    )
}

export default VhesManager
